import Todos from './components/Todos';
import Todo from './models/todo';

function App() {

  const todos = [
    new Todo(),
    new Todo()
  ];

  return (
    <div>
      <Todos items={['Learn React', 'Learn TS']} />
    </div>
  );
}

export default App;
